INSERT INTO `mysimplestory` (`id`, `story`, `totalPraise`, `uid`) VALUES
(4, '利用即时通讯软件微信，和客户技师建立好友关系，这样，如果场地有任何报错信息，客户可以马上拍照片发过来，通过图文并茂的方式即使了解故障信息，避免因为通话描述故障不清楚而反复确实，浪费时间！信息时代，用数字化的方式和客户一起解决问题', 11, 1391),
(6, '新杰还备件渠道很多，但电话难打，网络难上，邮件太慢，微信虽可，反应速度也不理想，并且没有规范模式。\n建议：\n1.能给出固定模板，定下回复运单号的时限\n2.最好能建公共平台，若能和库房关联备件运单信息，这样会极大的提高备件归还状态。避免重复工作！', 12, 1585),
(7, '建议一个区域内公司多指定几个物流公司，订备件的时候由FE决定使用哪个公司，这样物流公司之间就会竞争，更有利于我们的备件响应速度，同时也可能降低物流的cost', 10, 1586),
(8, '工程师通过800订备件时，每次800都会询问科室收货联系人的联系方式，但是该场地已经定过多次备件，建议800将定过备件的场地科室联系人做个记录，避免以后每次订备件都需要工程师提供查询。', 9, 1567),
(9, '备件到达场地时，送备件的人很多时候还要给工程师打电话再要一次客户联系方式。建议800下订单时将客户联系方式详细提供给物流。', 10, 1583),
(10, '客户报修，online联系客户无法解决问题时，如果能在分单给account fe同时将log以邮件形式发送给工程师，将会很大程度上提高维修的效率。因为工程师的3G网卡网速收邮件还可以，但是不足以支撑通过远程看机器log。', 10, 1578),
(11, '自从易签名投入使用后，就不用再交纸质的service record ，但是遇到用易签名关PM单子时，再单独交pm  report 很麻烦，并且经常会忘记交纸质的PM report.于是我就把PM report 做成电子版的，每次需要时修改一下，直接打印一下，交上去就可以了，这样节省了很多时间，也很少再忘记交pm link report 了。', 11, 1577),
(12, 'Concour系统速度很慢，需要改进提高。', 10, 1486),
(13, '制作电子版工程师资质证，便于向客户宣传打印。', 9, 1486),
(14, '建议aw 出厂时还是把USB key做好，让工程师在场地做USB key 很容易受网络条件限制，耽误时间。', 11, 1577),
(15, '在维修过程中经常会发现床外壳被病床撞击导致损坏，后来发现在我们设备床边添加一块大的透明塑料膜，这样病床推到机器床边时会收到很大摩擦力，起到缓冲作用，极大的减少了床的维修，从而极大的减少了时间和维修成本', 8, 1323),
(16, '建议取消EPM ，EPM实际作用不大，网络不好的话，又很浪费时间。同意的话请赞一个！', 13, 1577),
(17, 'E -payment 报销系统太复杂，建议简化。', 12, 1577),
(18, '应该使用大数据的方法和技巧分析客户订单，从而更好的预测市场变化和订单数量', 10, 3294),
(19, '现在很多工程师都开车去场地修机器，对于重要客户的紧急报修，在等备件期间即使加急，物流依然不给力，工程师能去机场自己接备件，然后自己根据安排送医院，或许有时会节省不少时间！', 9, 1582),
(21, '公司能多认证几个物流，各区可以根据区里物流情况选择合适的物流，而不是被选择，也让物流形成竞争关系，提高物流的服务质量和及时性！', 10, 1582),
(22, '建议公司为产品各个子系统做中文标牌，在装机时FE张贴到各个系统上并给客户进行介绍，以便客户分辨，提高account FE和OLE的remote fix rate.', 9, 1582),
(23, '工程师完成装机后，需要上传《设备安装完成报告》，完成EE提交等一系列后续工作，对于工程师而言，增加了大量工作！《设备安装完成报告》建议取消或者简化内容，提高工作效率', 10, 1391),
(24, '备件的运输及时性关系到客户的满意度，订好备件，跟踪备件的物流是非常繁琐的事情，我们需要找800同事查询，800同事再找别的人查询，再回复我们，效率低！建议设置一个类似与“顺丰”之类的物流做法，坐一个查询网站，工程师根据订单号可以自己登录查询跟踪，提高效率', 10, 1391),
(27, '建议构建PM report网络数据库，取消纸质PM report,工程师完成PM后撰写PM report,并像提交安装调试报告一样上传到对应的场地内，给需要的客户down下打印，不仅减少了工程师的工作量，也能节省大量的纸质！', 9, 1582),
(28, '我和account IB的相关技师都有建立微信联系方式，遇到问题他们会先发给我报错信息，能解决的第一时间电话指导，或者微信输入具体操作步骤，先恢复机器正常使用当成第一要务。现在医院对开机率要求越来越高，他们自己的压力也非常大，重压之下他们也会更愿意配合我们做一些基础维修，我觉得这是个可以作为维修基本流程的，熟悉场地和人员的FE比起在线OLE会更有把握解决问题。', 10, 1414),
(29, '在维修过程中，我们很容易遇到病人量大或着路途遥远的场地，一旦设备出问题，不仅客户急我们也很急，其实有时是一些很简单的issue，于是我们team做了一份简单的维修指导PPT，在不违法公司的政策下，将一些简单issue的处理方法告知客户，这样很大程度提高了remote fix rate 和节省了大量时间和cost', 9, 1323),
(30, '在维修过程中，我们很容易遇到病人量大或着路途遥远的场地，一旦设备出问题，不仅客户急我们也很急，其实有时是一些很简单的issue，于是我们team做了一份简单的维修指导PPT，在不违法公司的政策下，将一些简单issue的处理方法告知客户，这样很大程度提高了remote fix rate 和节省了大量时间和cost', 10, 1323),
(31, '在跟客户沟通的过程中发现，相比较于销售而已，FE的话更能另客户信服，我想如果FE在场地时，选择适当的时候介绍公司新的产品，应该会收到很好的效果，但目前而已，公司新产品的详细信息FE得不到，也没有一个新产品的说明给FE，而往往客户最喜欢跟FE讨论我们公司产品跟其他品牌相应产品来做比较，FE就有点捉襟见肘了，我觉得这样丧失了一大销售助力。可以考虑给FE一些产品说明的培训！', 10, 1323),
(32, '对于一些VIP客户机器的保养我们有时会让医院保管一套常规PM工具，这样客户觉得被重视之余也让FE少却带工具之累，客户觉得很好', 10, 1323),
(33, '新装机时要给客户灌输好一定的思想，例如一定要控制好温度，湿度，灰尘，如果不控制好会出现什么样故障。科室要配备温湿度计，吸尘器嗯嗯，这个时候做好工作，以后保养维修，将省去很多时间', 10, 1577),
(34, '装机结束后可以给客户做个简单的维修培训，让他们具备处理简单小问题的能力，这样会减少很多on site 次数，节省cost', 10, 1577),
(35, '每到周六周天FEMC都不能关单，系统维护时间太长了。给FE关单带来很多不便。建议缩短系统维护时间。', 8, 1583),
(36, 'FMI时，有些客户常时间不联系或人员变动，很难再与客户联系上，为FMI的快速完成造成很多影响。建议公司发布FMI时，有人提前先与客户联系，并在发布FMI时将有效的联系人联系方式发给场地FE。', 8, 1583),
(37, '在完成设备安装之后，需要医院签《设备安装完成确认函》但在实际中可能因为一些商务问题或者客户的不理解，往往客户延迟签字，往往需要工程师多次去场地为了拿签收而浪费精力和成本，能否建立跨部门协同机制，有sitting FE,sales和安装工程师一起协同，保证最快签收', 10, 1391),
(38, '目前service维修和销售各自独立，在场地如果出现客户需要购买备件的情况，要通知service sales同事介入，然后工程师就是被动等消息！能否设置一个流程，对于一定金额之内的备件，可以在工程师判断完故障备件后直接跟客户讨论商务问题，敲定价格，签订购买合同！提高维修效率', 9, 1391),
(39, 'x-ray产品种类繁多，其中小产品占了大半，一些安装时间10年左右的小产品，因为一直没有我们公司的维修，没有任何服务联系，对于设备的情况没有任何记录，这批设备却一直在我们的区IB里，每次统计和分配都是繁琐和无奈！对于安装年限超过8年，在5年之内没有跟GEService有任何维修合同的，能否将这批设备从总IB清除掉，简化系统容量', 8, 1391),
(40, 'CT设备发送到场地的时候，床的运输架有几款是没有安装，需要在场地安装，很费时间，能否都统一在工厂安装完毕后发到场地，节省时间。', 8, 1323),
(41, 'INNOVE新装机设备到场地后，需要工程师自己拆箱，运输到装机房间进行就位安装，其中的两个系统柜C1C2没有运输轮和工具，需要靠蛮力搬运，非常危险！而C柜重约600公斤，我们每次都需要找医院借液压车，找人来帮忙，需要浪费时间，协调人员！有的场地没有液压车，这就需要去租工具或者找外面的a搬家公司！能否在工具库房放置液压车供装机用，避免去跟医院协调借工具而引起的时间厌恶及客户觉得我们公司不专业', 9, 1391),
(42, '是否能恢复原来AW的USB装license，现在的license需要手动输入，原来一份钟可以干完的事情有的机型可能要一个小时才能完成了，如果觉得USB成本高，做成光盘可以吗？', 9, 1323),
(43, 'OTR上传到installation 上的packing list 不够详细，往往和现实的装箱单没发对照，给现场工程师点货造成很大的不便，很浪费时间。', 7, 1577),
(44, 'OLE分单给FE时是否可以将有价值的errorlog发给FE，现在默认是不发送，除非要求，如果默认发送的话，这样提高troubleshooting效率', 7, 1323),
(45, 'CT球馆箱里是否可以增加一个吊装工具，这样就不用FE带着沉重的吊链在路途了，而且公司统一管理工具也方便', 7, 1323),
(46, '餐补是公司给予员工的福利，作为一项福利，能否跟私车公用一样无需提供发票，直接并入工资计税，简化员工报销手续', 9, 1391),
(47, '餐补是公司给予员工的福利，作为一项福利，能否跟私车公用一样无需提供发票，直接并入工资计税，简化员工报销手续', 8, 1391),
(48, '经常在工作中接到客户一些应用方面的咨询电话，但对于一些高级应用方面的培训缺乏，只能让客户联系应用培训工程师，而客户一般不会存留培训工程师电话，所以很少第一时间联系到培训工程师，建议在800维修电话加一个转接号，直接能联系到负责的培训工程师，提高客户满意度', 8, 1391),
(49, 'Eqm现在只能用连接电脑，然后让客户签名，客户和工程师感觉都不方便，签名笔和蓝牙接收器也非常容易坏，如果能更新到ipad上，客户直接在ipad上签名或许能更方便和专业！', 6, 1582),
(50, '一般做完service都会给客户一份service record记录，但客户经常会弄丢，逢检查时候又会要我们再给他们一份，还好我们SDS那都有存档，无论客户要哪个时间段的，都可以整理出来马上复印邮寄给他，这个方式非常好，不知其他区是否一样。', 5, 1414),
(51, '建议每个办公室能配一套专业的CT PM工具箱，这样既能体现我们的专业性，又能提高我们的PM质量。', 4, 1577),
(52, '建议每个办公室能配一套专业的CT PM工具箱，这样既能体现我们的专业性，又能提高我们的PM质量。', 4, 1577),
(53, '给MSA的客户做个简单维修培训，他能帮我能解决很多小问题，节省cost,提高开机率。', 4, 1577),
(54, 'EMG关单需要24小时内关到30状态，即24小时内报告有无病人因为设备受伤或死亡，可否简化成如果有病人因为设备受伤或死亡的，必须要24小时内报告，其他没有的不需要提交，否则平日工作很忙，来不及24小时内关到30''状态会被算defect，很冤，而且没有意义', 6, 1507),
(55, '在Installation过程中发生ED issue，报告给相关部门到备件返回场地的反应时间太长，往往需要从工厂发到上海再到场地，还有可能全球无货，希望能简化此类流程，国内备足相关备件，以达到客户满意度.', 6, 1493),
(56, '公司付款流程复杂，很多摸底实验测试在国内实验室进行，很难都要走高风险付款。', 4, 5452),
(57, '公司付款流程复杂，很多摸底实验测试在国内实验室进行，很难都要走高风险付款。', 4, 5452),
(58, 'Design control 流程从来只做加法不做减法，即便是做简化，也只是在文档上做简化，而没有真正从流程简化。', 4, 5452),
(59, 'service过程中碰到可以自己修好的备件，也就是有些板卡可以维修到芯片级，例如某个故障需要换一块板子，实际上就是上面的一个电子元器件坏了，如果我们手上刚好有这个器件，直接换掉就能解决问题。建议公司鼓励大家总结类似经验，加以推广，然后做成一个小器件的备件包随身携带，相信这不止省成本，也能大大增加uptime。', 4, 1414),
(60, '公司发放VCP是整合到工资中一起发放的，是否可以分开发放或者可以员工两张卡，一张发放工资，一张发放VCP，这样公司可以合理的避税，也真正为员工的福利着想了', 4, 1323),
(61, '可以对工程师进行适当的产品应用培训方面的知识，方便与客户沟通交流，第一时间消除客户疑虑，获得信任', 3, 1507),
(62, '场地EE几乎或多或少都有问题，导致设备后续使用出现难疑难问题。是否每个区都备一套EE检测设备，减少物流带来的费用与及时了解EE给设备带来的影响。建议备EE检测设备到每个区，由专人保管及维护，已达到设备的正常开机率', 3, 1493),
(63, '建议开发app的service微信平台，整个所有资源。进入了4G时代，实时通信，实时沟通，实时反应问题，都应该进入e时代了。现在还处于2g的沟通时代。实在没法跟上时代的步伐。建议给一线员工配置实时通信工具和响应的平台。', 1, 1514),
(64, '建议service相关部门把已有的资源整合，编写app的软件或者在线平台。实时查阅数据和上传数据。比如公司政策，技术文件等等都有相应的app软件可以查询。将要极大的提高一线员工的工作效率。在去客户的路上就办好了一切。', 1, 1514),
(65, '有遇到订LS采购的DVD连续几个都不能正常使用的情况，完成很大的客户抱怨，能否在LS的备件放入库房之前先测试一遍，保证发出的备件都好用，减少现场维修周期', 1, 1391),
(66, '目前工程师去场地装机，如果因为场地问题不满足装机条件，需先发邮件给负责INS部门，经相关同事再转发sitting的同事一起同意才能开004的单子，流程繁琐，耗时！场地是否合格，场地工程师最清楚，是否开004的派工单应该直接由安装工程师跟场地工程师电话确认好直接派工，减少批准流程\n', 0, 1391),
(67, '后台同事因为工作原因经常变动职位，作为前线工程师经常发现在需要找相关同事时经常出错，四处问询！目前人人都使用即时通讯工具，邮件的关注度低下，能否设立一个service专用微信平台，定期推送给前线各个部门的最新联系人，联系方式，便于前线做出有效的查询和联系', 0, 1391),
(68, 'OTR部门负责发货，service负责安装，这是两个紧密联系的部门，目前新设备到场地，拆箱安装过程中经常会发现少发货，这时安装工程师再联系OTR同事询问，给装机造成被动和延误，有时也引起客户抱怨！发货是否齐全，OTR应该有记录，能否在发货时同时通知INS leader或者在installation网站更新，这样安装工程师在安装之前就了解是否缺货，提前做好相应的安装计划，提高安装效率', 0, 1391);
